import React, { useState } from 'react';

function RegisterPage() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleRegister = () => {
    // handle register logic here
    console.log(`Registering with username: ${username}, email: ${email}, and password: ${password}`);
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <div style={{ display: 'flex', flexDirection: 'column', width: '400px', justifyContent: 'center', alignItems: 'center' }}>
        <h1>Register Page</h1>
        <label style={{ marginBottom: '10px' }}>
          Username:
          <input type="text" value={username} onChange={(e) => setUsername(e.target.value)} style={{ marginLeft: '10px' }} />
        </label>
        <label style={{ marginBottom: '10px' }}>
          Email:
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} style={{ marginLeft: '29px' }} />
        </label>
        <label style={{ marginBottom: '10px' }}>
          Password:
          <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} style={{ marginLeft: '10px' }} />
        </label>
        <button onClick={handleRegister} style={{ marginTop: '10px' }}>Register</button>
      </div>
    </div>
  );
}

export default RegisterPage;
